import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import { Home, Aboutaone, Aboutaone2, Aboutaone3, Aboutaone4} from '../pages';


class App extends Component {
    render() {
        return (
            <div>
                <Route exact path="/" component={Home}/>
                <Route exact path="/aboutaone" component={Aboutaone}/>
                <Route exact path="/aboutaone2" component={Aboutaone2}/>
                <Route exact path="/aboutaone3" component={Aboutaone3}/>
                <Route exact path="/aboutaone3" component={Aboutaone4}/>
      
            </div>
        );
    }
}

export default App;
